import React, { Component } from 'react';
import './css/App.css';

class App extends Component {
	render() {
	  return (
		<div>
		  <h1>Hola Mundo!</h1>
		  <p>Bienvenidos a los primeros pasos con React</p>
		</div>
	  );
	}
  }

export default App;
